### Core Equations and Concepts

#### JavaScript
1. **Variable Declarations**
   - `var`: Function-scoped, hoisted, can be redeclared
   - `let`: Block-scoped, hoisted but not initialized, cannot be redeclared
   - `const`: Block-scoped, hoisted but not initialized, cannot be reassigned

2. **Arrow Functions**
   - Syntax: `(params) => expression`
   - No binding of `this`, `arguments`, `super`, or `new.target`

3. **Event Loop**
   - Call stack: LIFO structure for function execution
   - Callback queue: FIFO structure for asynchronous callbacks
   - Event loop: Moves callbacks from the queue to the stack when the stack is empty

4. **Destructuring**
   - Array destructuring: `const [a, b, ...rest] = array;`
   - Object destructuring: `const { name, age } = object;`

#### Vue.js
1. **Lifecycle Hooks**
   - `beforeCreate`: Called before the instance is initialized
   - `created`: Called after the instance is created
   - `beforeMount`: Called before the template is rendered
   - `mounted`: Called after the template is rendered

2. **Component Communication**
   - Props: Pass data from parent to child
   - Events: Emit events from child to parent
   - Slots: Distribute content from parent to child

